import React,{useState} from 'react';
import DatePicker from 'sassy-datepicker';

function Example() {
    const onChange = (date) => {
      console.log(date.toString());
    };
  
    return (
      <DatePicker onChange={onChange} />
    );
  }
function Search() {
    return (
      <DatePicker onChange={onChange} />
    );
  }

export default Search;
